import React, { Component } from 'react';
import { ProgressBar } from '@../../../../reactify/build';
import {
  simpleCode,
} from './code-refrence';
import './progress-bar.scss';
import DemoCard from '../../components/demo-card';

class ProgressBarDemo extends Component {
  state = { runningPercentage: 0 }

  render() {
    return (
      <div>
        <DemoCard
          title="onSelection"
          uniqueIdentifier="onSelectionUse"
          sourceCode={simpleCode}
        >
          <ProgressBar striped primary percentage={30}>30% complete</ProgressBar>
          <ProgressBar striped success percentage={60}>60% complete</ProgressBar>
        </DemoCard>
      </div>
    );
  }
}

export default ProgressBarDemo;
